import React from "react";
import { Col, Row, Container } from "reactstrap";
import "../assets/css/Banner.css";

import BannerLeftImg from '../assets/imgs/banner-left.jpg';
import BannerRight1Img from '../assets/imgs/banner-right1.jpg';
import BannerRight2Img from '../assets/imgs/banner-right2.jpg';
import BannerRight3Img from '../assets/imgs/banner-right3.jpg';

export default function Banner() {
    return (
        <Container className='mt-4'>
            <Row>
                <Col xl={6}>
                    <div className='banner-left'>
                        <img src={BannerLeftImg} className='img-fluid' />
                    </div>
                </Col>
                <Col xl={6}>
                    <Row>
                        <Col xl={6}><img src={BannerRight1Img} className='img-fluid'/></Col>
                        <Col xl={6}><img src={BannerRight2Img} className='img-fluid'/></Col>
                    </Row>
                    <Row>
                        <Col xl={12}><img src={BannerRight3Img} className='img-fluid'/></Col>
                    </Row>
                </Col>
            </Row>
        </Container>
    );
}
